import React from 'react';

const DIYClass1 = () => {
    return (
        <div>
            <h1>홈</h1>
            <p>이곳은 홈입니다. 가장 먼저 보여지는 페이지 입니다.</p>
        </div>
    );
};

export default DIYClass1;
